import { personType} from './person-type.model.js';
import {employmentType} from './employment.model.js';
import { session } from './session.model.js';
import { person } from './person.model.js';

export class register{

    //Fields 
    person: person
    school: string
    isAttendingDinner: boolean
    sessionOne: session
    sessionTwo: session
    isEmployed: boolean
    employmentType: employmentType
    personType: personType



    constructor (){
           this.person = new person();
           this.isAttendingDinner = false;
           this.school = "";
           this.sessionOne = new session();
           this.sessionTwo = new session();
           this.personType = personType.unset;
           this.isEmployed = false; 
           this.employmentType = employmentType.unset;
    }

}
